import React, { Component } from "react";

export default class Step6 extends Component {
   state = {};

   componentDidMount() {}

   componentWillUnmount() {}

   render() {
      return (
         <div className="step step6">
            <h2>Thanks!</h2>
            <h4>Data was successfully saved to cloud.</h4>
         </div>
      );
   }
}
